rol untuk mengubah volume suara tanpa perlu menyentuh smartphone.</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Ultra Long Standby Battery</span></div><div><span style=\"color: rgb(0, 0, 0);\">Baterai dari Remax headset ini mampu bertahan hingga 80 jam mode standby dalam sekali pengisian baterai, dan 4 jam berturut turut untuk digunakan.</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Magnet Case</span></div><div><span style=\"color: rgb(0, 0, 0);\">Case bagian luar earphone ini memiliki magnet sehingga Anda dapat menempel earphone kiri kanan menjadi satu dan menjadikan earphone seperti kalung.</span></div>',NULL,0,'2019-07-07 00:00:00','2019-07-07 14:41:37',NULL,NULL,'https://sanporium.com/product-category/aksesoris/','6282283401530','Hai Min, Saya Mau Pesan Bluetooth Earphone Remax'),
