(59,'Speaker Mini Bluetooth Remax Ori','Remax Original Brand','SpeakerMini',195000,295000,75,NULL,'<div><span style=\"color: rgb(0, 0, 0);\">Speaker Mini Bluetooth Remax Ori</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Wireless Bluetooth Speaker Portable Mini metallic support TF card HD Sound Transport Call Function Speaker with Mic</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Dilengkapi dengan slot kartu microSD untuk pemutaran musik. Ada Auxiliary di</span></div><div><span style=\"color: rgb(0, 0, 0);\">pelabuhan (AUX) sehingga kamu dapat menghubungkan perangkat kamu ke speaker.</span></div><div><span style=\"color: rgb(0, 0, 0);\">Desain elegant dan premium.</span></div><div><span style=\"color: rgb(0, 0, 0);\">.</span></div><div><span style=\"color: rgb(0, 0, 0);\">Speaker ini juga mampu menerima panggilan telepon saat terhubung ke smartphone</span></div><div><span style=\"color: rgb(0, 0, 0);\">melalui mikrofon khusus, yang membuat produk ini serbaguna.</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Highlights :</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) Bluetooth versi 4.0</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) Micro SD Slot</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) AUX PORT</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) CNC Aluminium Material</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) Dual Driver 3W</span></div><div><span style=\"color: rgb(0, 0, 0);\">Detail body dengan design yang original dibuat dari bahan material full metal</span></div><div><span style=\"color: rgb(0, 0, 0);\">menampilkan kesan yang elegan dan kokoh serta berfungsi untuk memancarkan suara</span></div><div><span style=\"color: rgb(0, 0, 0);\">yang lebih jernih dan berkualitas.</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) Built In HD Microphone</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) Size 85 x 85 x 34mm</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) 5 Jam Pemakaian terus-menerus</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) 14 Jam Waktu Bicara</span></div><div><span style=\"color: rgb(0, 0, 0);\">(+) 60 Jam Standby</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Range : 10 m</span></div><div><span style=\"color: rgb(0, 0, 0);\">Kekuatan Speaker : 3W</span></div><div><span style=\"color: rgb(0, 0, 0);\">Power : DC5+-0.25V</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Apa yang ada di dalam kotak:</span></div><div><span style=\"color: rgb(0, 0, 0);\">1* Speaker Mini Bluetooth Remax Ori</span></div><div><span style=\"color: rgb(0, 0, 0);\">1* USB Cable&nbsp;</span></div><div><span style=\"color: rgb(0, 0, 0);\">1* Audio Cable</span></div><div><span style=\"color: rgb(0, 0, 0);\">1* Manual</span></div><div><br></div>',NULL,0,'2019-07-07 00:00:00','2019-07-07 15:09:38',NULL,NULL,'https://sanporium.com/product-category/aksesoris/','6282283401530','Hai Min, Saya Mau Pesan Speaker Mini Bluetooth'),
(60,'Handuk Sport Edition Remax Ori','Remax Original Brand','HandukSport',125000,175000,99,NULL,'<div><div><span style=\"color: rgb(0, 0, 0);\">Handuk Sport Edition Remax Ori</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Features</span></div><div><span style=\"color: rgb(0, 0, 0);\">Fast Dry Towel</span></div><div><span style=\"color: rgb(0, 0, 0);\">Handuk ini memang didesian khusus untuk kebutuhan olahraga yang mengeluarkan keringat sangat banyak. Handuk dapat menyerap keringat dengan cepat dan langsung dapat kering dalam sekejap sehingga handuk tidak terlalu basah.</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">Cold Towel</span></div><div><span style=\"color: rgb(0, 0, 0);\">Selain cepat kering, handuk ini juga memberi sensasi dingin pada kulit tubuh sehingga Anda tidak merasa terbeban saat menggantung handuk di leher. Karena handuk pada umumnya pasti membuat gerah bagian tubuh yang bersentuhan dengan handuk.</span></div><div><span style=\"color: rgb(0, 0, 0);\"><br></span></div><div><span style=\"color: rgb(0, 0, 0);\">3 Layer Towel</span></div><div><span style=\"color: rgb(0, 0, 0);\">Hot to Cold</span></div><div><span style=\"color: rgb(0, 0, 0);\">Untuk mendinginkan kembali handuk Remax ini dapat dilakukan dengan cari mencelup handuk ke air panas selama beberapa saat dan kemudian keringkan sekitar 3-5 menit. Setelah itu handuk akan kembali dingin.</span></div></div><div><br></div>',NULL,0,'2019-07-07 00:00:00','2019-07-07 15:23:11',NULL,NULL,'https://sanporium.com/product-category/aksesoris/','6282283401530','Hai Min, Saya Mau Pesan Handuk Sport Edition Remax');
